import React from "react";

const DisplayTodo = ({ todos }) => {
  return (
    <>
      <div>
        <p>ID: {todos.id}</p>
        <p>Title: {todos.title}</p>
        <p>Body: {todos.body}</p>
        <p>Created At: {todos.created_at}</p>
        <p>Updated At: {todos.updated_at}</p>
      </div>
    </>
  );
};

export default DisplayTodo;
